import { useState } from 'react';
import './App.css';
import { LoginForm } from './components/login'

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false)

  return (
    <LoginForm isLoggedIn={isLoggedIn} />
  );
}

export default App;
